  //cases -> case# -> rarity  -> weaponname, price, img
  //cases -> case1 -> milspec -> weap1.name

  //blues = 70%, purple = 20%, pink = 5%, red = 2.50%, knife = 0.50%

  var rarityValue = {
    milspec: 0.75,
    restricted: 0.92,
    classified: 0.97,
    stattrak: 0.98,
    covert: 0.995,
  };

  function randSkin() {
    var skinsArray = [];
    var randSkin = "";
    var randNum = Math.random().toFixed(3); //rounded to 3 places to make it slightly easier to get certain rarities
    var rarity = "";
    var identifier;

    if (randNum <= rarityValue.milspec) {
      rarity = "milspec";
    } else if (
      randNum >= rarityValue.milspec &&
      randNum <= rarityValue.restricted
    ) {
      rarity = "restricted";
    } else if (
      randNum >= rarityValue.restricted &&
      randNum <= rarityValue.classified
    ) {
      rarity = "classified";
    } else if (
      randNum >= rarityValue.classified &&
      randNum <= rarityValue.stattrak
    ) {
      rarity = "stattrak";
    } else if (
      randNum >= rarityValue.stattrak &&
      randNum <= rarityValue.covert
    ) {
      rarity = "covert";
    } else {
      rarity = "knife";
    }

    function skinChoose(r) {
      if (r === "knife") {
        var knifeCase = "";
        if (currentCase === "case13") {
          knifeCase = "chroma";
        } else if (currentCase === "case13") {
          knifeCase = "chromast";
        } else if (currentCase === "case14") {
          knifeCase = "chroma";
        } else if (currentCase === "case14") {
          knifeCase = "chromast";
        } else if (currentCase === "case19") {
          knifeCase = "chroma";
        } else if (currentCase === "case19") {
          knifeCase = "chromast";
        } else if (currentCase === "case9") {
          knifeCase = "huntsman";
        } else if (currentCase === "case9") {
          knifeCase = "huntst";
        } else if (currentCase === "case10") {
          knifeCase = "butterfly";
        } else if (currentCase === "case10") {
          knifeCase = "butterst";
        } else if (currentCase === "case16") {
          knifeCase = "shadow";
        } else if (currentCase === "case16") {
          knifeCase = "shadowst";
        } else if (currentCase === "case15") {
          knifeCase = "falchion";
        } else if (currentCase === "case15") {
          knifeCase = "falchionst";
        } else if (currentCase === "case18") {
          knifeCase = "bowie";
        } else if (currentCase === "case18") {
          knifeCase = "bowiest";
        } else if (currentCase === "case20") {
          knifeCase = "gamma";
        } else {
          knifeCase = "regular";
        }

        skinsArray = Object.keys(knives[knifeCase]);

        randSkin = skinsArray[Math.floor(skinsArray.length * Math.random())];

        identifier = knives[knifeCase][randSkin];

        //console.log(identifier.name);
        //console.log(identifier.price);
        //console.log(identifier.img);
        var toEncode = "knives['" + knifeCase + "']" + "['" + randSkin + "']";
        inventory["item" + itemCounter] = window.btoa(toEncode);

        drawItem(
          itemDisp(identifier.name, identifier.price, identifier.img),
          rarity
        );

        if (popup) {
          caseModalDraw(identifier.name, identifier.img);
          $(".modalWindow").toggle();
        }
      } else {
        //console.log(r);
        skinsArray = Object.keys(cases[currentCase][r]);

        randSkin = skinsArray[Math.floor(skinsArray.length * Math.random())];

        identifier = cases[currentCase][r][randSkin];

        //console.log(identifier.name);
        //console.log(identifier.price);
        //console.log(identifier.img);
        var toEncode =
          "cases['" +
          currentCase +
          "']" +
          "['" +
          r +
          "']" +
          "['" +
          randSkin +
          "']";
        //console.log(toEncode);
        inventory["item" + itemCounter] = window.btoa(toEncode);
        //console.log(cases[currentCase][r][randSkin]);

        drawItem(
          itemDisp(identifier.name, identifier.price, identifier.img),
          rarity
        );

        if (popup) {
          caseModalDraw(identifier.name, identifier.img);
          $(".modalWindow").toggle();
        }
      }

      inventoryCurrent += 1;
      itemCounter += 1;
    }

    skinChoose(rarity);
  }

  function itemDisp(name, price, img) {
    var temp = [];

    temp.push(name, price, img);
    //console.log(temp);
    return temp;
  }

  function drawItem(array, rarity) {
    var name = array[0];
    var price = "$" + array[1].toFixed(2);
    var img = array[2] + "/70fx70f";

    $(".inventoryItemContainer").append(
      '<div class="inventoryItem ' +
        rarity +
        '" id="' +
        "item" +
        itemCounter +
        '" title="' +
        name +
        '"><div class="itemPrice">' +
        price +
        "</div> <img src=" +
        img +
        "> </div>"
    );
  }

  function inventoryClear() {
    inventory = {};
    $(".inventoryItemContainer").html("");
  }

  function drawInventory() {
    // I know this is cancer dont hate please
    var keys = Object.keys(inventory);

    for (var i = 0; i < keys.length; i++) {
      var rarity = atob(inventory[keys[i]])
        .replace(/\[[^\[]*$/g, "")
        .match(/\[[^\[]*$/g)
        .toString()
        .match(/\b\w*\b/)[0];
      if (
        rarity === "regular" ||
        rarity === "butterst" ||
        rarity === "falchionst" ||
        rarity === "chromast" ||
        rarity === "chroma" ||
        rarity === "huntsman" ||
        rarity === "gamma" ||
        rarity === "huntst" ||
        rarity === "butterfly" ||
        rarity === "shadow" ||
        rarity === "shadowst" ||
        rarity === "bowie" ||
        rarity === "bowiest" ||
        rarity === "falchion"
      ) {
        rarity = "knife";
      }
      var item = eval(atob(inventory[keys[i]]));
      var name = item["name"];
      var price = "$" + item["price"].toFixed(2);
      var img = item["img"] + "/70fx70f";

      $(".inventoryItemContainer").append(
        '<div class="inventoryItem ' +
          rarity +
          '" id="' +
          keys[i] +
          '" title="' +
          name +
          '"><div class="itemPrice">' +
          price +
          "</div> <img src=" +
          img +
          "> </div>"
      );
    }
  }

